import React from "react";
import HomePage from "./home/HomePage";
import AboutPage from "./about/AboutPage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Route path="/" element={<HomePage />} />
    </Router>
  );
}

export default App;
